import React from 'react';
import './card.scss';

export const Card = (props) => {
  const {image, name, gender} = props;
  return (
    <>
      <div className='card'>
        <img className='card-image' src={image} alt={name} />
        <h3>{name}</h3>
        <p>{gender}</p>
      </div>
    </>
  );
};
